Content:
【1】学習内容（テックスタディ／JavaScript）
・教材：JavaScript
【2】サマライズテーマ 
 ・ 様々な関数定義
【3】オリジナル解説文
・関数宣言_先に読み込まれる
function calc(num1,num2){
return num1*num2
}
const num1=3
const num2=4
console.log(calc(num1,num2))
・関数式_先に読み込まれることがない為、読み込ませたくないときに使用
const hello=function(){
console.log(`hello`)
}
・無名関数_関数名なしで関数定義可能
const countNum=function(){
console.log(num)
}
countNum(1)
・即時関数_関数定義後にすぐに実行される
(function countNum(num) {
console.log(num)
}) (1)
・アロー関数_短い記述で関数を定義可能
const countNum(num)=>{
console.log(num)
}
countNum(1)
【4】言語化してみての気づき（任意）
・RubyとJavaScriptでコーディングの違いがあるが、サマリノートがあれば混乱も防げそう
・JavaScriptの関数は記述方法が複数あり、使い処の感覚はカリキュラムを進めていく中で掴めそう
